import React from 'react';


const About = () => {
return (
<div className="Instructions container">
    <div className="flow-text">
        <h1>About the Intention Web App</h1>
        <ul>
            <h4>What is Intention?</h4>
            <li>Intention is a community of healers. We strive to join people together believing a united future is a worthy dream.
            </li>
            <h4>How do I get involved?</h4>
            <li>Read through the instructions page and practice on your own loved ones. After you're comfortable with the process, pick a request to respond to in the healing circle.
            </li>
            <h4>Is Intention affiliated with a religion or group?</h4>
            <li>Healing can occur across multiple avenues. Intention isn't affiliated with any religion or group and strives to include all people.
            </li>
            <h4>What happens to my data I provide to Intent?</h4>
            <li>Intent will not sell your data. The data you include in a healing will be public, so keep in mind what you share. Using intent is a free service and will strive to stay that way.
            </li>
        </ul>
    </div>
</div>
);
};

export default About;
